(43, 1, '2020-07-29 15:33:11', '2020-07-29 08:33:11', 'Toyota Yaris Cross 2020 vừa trình làng thị trường Thái Lan với nhiều cải tiến đáng kể. Yaris Cross được Toyota Motor Thailand phân phối với nhiều phụ kiện như mui xe sơn đen, cánh gió bên, la-zăng hợp kim 16 inch đặt riêng, trang trí vòm bánh xe. Chiều cao thân xe còn có thể nâng thêm 30 mm nhờ có hệ thống lò xo và giảm xóc mới.\r\n\r\nYaris Cross có 3 phiên bản tất cả với giá lần lượt: Bản tiêu chuẩn khoảng 410,9 triệu VNĐ; bản tầm trung khoảng 449,1 triệu VNĐ và bản cao cấp khoảng 494,8 triệu VNĐ.\r\n\r\nNgoài ra, động cơ xăng 1.2L (3NR-FXE) của Yaris Cross cũng được nâng cấp, có thêm hệ thống van biến thiên kiểm soát điện tử VVT-iE.<img src=\"https://static.carmudi.vn/wp-content/uploads/2019-11/O9jszEGa7N.jpg\" alt=\"Toyota Yaris Cross\" />', 'Toyota Yaris Cross 2020 Thái Lan', '', 'publish', 'closed', 'closed', '', 'toyota-yaris-cross-2020-thai-lan', '', '', '2020-07-29 15:33:11', '2020-07-29 08:33:11', '', 0, 'http://thanhvinhweb.net/?post_type=san-pham&#038;p=43', 0, 'san-pham', '', 0),
(44, 1, '2020-07-29 15:35:55', '2020-07-29 08:35:55', '<img class=\"fr-fic fr-dib img-fluid lazyloaded\" src=\"https://static.carmudi.vn/wp-content/uploads/2019-11/8gDdGqybYg.jpg\" alt=\"Toyota Yaris Ativ\" data-src=\"https://static.carmudi.vn/wp-content/uploads/2019-11/8gDdGqybYg.jpg\" />\r\n\r\nToyota Vios 2020 hoàn toàn mới cũng vừa ra mắt tại thị trường Thái Lan với giá chỉ 16.450 USD (~ 380 triệu VNĐ). Mẫu xe hơi này là đối thủ cạnh tranh của Hyundai Accent, Honda City và Mazda 2.\r\n\r\nMẫu sedan hạng B Toyota Yaris Ativ 2020 (còn có tên Toyota Vios tại thị trường Việt nam) chuyển sang dùng cụm động cơ mới với mức tiêu thụ nhiên liệu tiết kiệm hơn đáng kể.\r\n\r\nTheo đó, động cơ xăng 4 xi-lanh 1.2L (3NR-FXE) bên dưới nắp ca pô của Toyota Vios sử dụng hệ thống van biến thiên kép điện tử sản sinh công suất 92 mã lực tại 6.000 vòng/phút và 109 Nm tại 4.400 vòng phút.\r\n\r\nNhờ được bổ sung thêm tính năng tự ngắt máy khi dừng đèn đỏ, mức tiêu hao nhiên liệu của Yaris Ativ chỉ ở khoảng 4,3L/100 km, đạt tiêu chuẩn khí thải Euro 5 trong khi phiên bản hiện hành chỉ đạt tiêu chuẩn Ecocar I và Euro 4. Ngoài ra, hộp số vẫn là dạng vô cấp CVT với chế độ Sport.\r\n\r\nMặc dù động cơ yếu hơn nhưng việc có thêm vài tính năng khiến giá xe của Toyota Yaris Ativ 2020 cao hơn từ 658 - 987 USD (~15 - 22,8 triệu VNĐ) tùy theo phiên bản. Bản đời cao - 20.374 USD (~472 triệu VNĐ), bản tầm trung - 19.716 USD (~457 triệu VNĐ), bản tiêu chuẩn - 18.070 USD (419 triệu VNĐ) và bản rẻ nhất có giá bán 16.450 USD (~380 triệu VNĐ).', 'Toyota Vios 2020 tại Thái Lan', '', 'publish', 'closed', 'closed', '', 'toyota-vios-2020-tai-thai-lan', '', '', '2020-07-29 15:35:55', '2020-07-29 08:35:55', '', 0, 'http://thanhvinhweb.net/?post_type=san-pham&#038;p=44', 0, 'san-pham', '', 0),
(45, 1, '2020-07-29 15:35:50', '2020-07-29 08:35:50', '', 'b', '', 'inherit', 'open', 'closed', '', 'b', '', '', '2020-07-29 15:49:54', '2020-07-29 08:49:54', '', 44, 'http://thanhvinhweb.net/wp-content/uploads/2020/07/b.jpg', 0, 'attachment', 'image/jpeg', 0),
(46, 1, '2020-07-29 15:37:51', '2020-07-29 08:37:51', '<img class=\"fr-fic fr-dib img-fluid lazyloaded\" src=\"https://static.carmudi.vn/wp-content/uploads/2019-11/rKk8JXEecF.jpg\" alt=\"Toyota Glanza\" data-src=\"https://static.carmudi.vn/wp-content/uploads/2019-11/rKk8JXEecF.jpg\" />\r\n\r\nToyota Glanza có thiết kế ngoại thất gần như y hệt Suzuki Baleno, chỉ khác ở  phầnlưới tản nhiệt và logo hãng. Tuy nhiên, phần đầu xe Glanza 2020 mới trông đẹp mắt và mạnh mẽ hơn so với Suzuki Baleno.\r\n\r\nToyota Glanza thế hệ mới tại Ấn Độ gồm 2 phiên bản trang bị là G và V. Các trang bị bao gồm; Kính cửa sổ ngăn tia UV, điều hòa tự động, hệ thống thông tin giải trí màn hình cảm ứng 7 inch, tương thích Apple CarPlay/Android Auto và hệ thống định vị dựa trên điện thoại thông minh. Phần lớn những tính năng chính này đều nằm trong loạt trang bị tiêu chuẩn.\r\n\r\nXe có động cơ kết hợp với hộp số sàn 5 cấp hoặc CVT. Lượng xăng tiêu thụ trung bình của cụm động cơ này là 21,01 km/L (4,75 lít/100 km) khi kết hợp với hộp số sàn và 19,56 km/L (5,11L/100 km) với CVT.\r\n\r\nTại thị trường xe Ấn Độ, Toyota Glanza có giá từ 847.000 Rupee (~275,92 triệu VNĐ).', 'Toyota Glanza 2020 tại Ấn Độ', '', 'publish', 'closed', 'closed', '', 'toyota-glanza-2020-tai-an-do', '', '', '2020-07-29 15:37:51', '2020-07-29 08:37:51', '', 0, 'http://thanhvinhweb.net/?post_type=san-pham&#038;p=46', 0, 'san-pham', '', 0),
