(50, 1, '2020-07-29 15:41:30', '2020-07-29 08:41:30', '<a class=\"\" title=\"xe oto duoi 600 trieu\" href=\"https://sanxeoto.com/images/source/gia_xe_oto/xe-oto-duoi-600-trieu-2.jpg\" data-fancybox=\"gallery\"><img class=\"prettyimg\" src=\"https://sanxeoto.com/images/source/gia_xe_oto/xe-oto-duoi-600-trieu-2.jpg\" alt=\"xe oto duoi 600 trieu\" width=\"640\" height=\"426\" /></a>\r\n\r\nChú trọng tính năng an toàn là trên hết, tạo nên sự yên tâm cho các khách hàng khi mua Fiesta là chuẩn mực mà Ford muốn xây dựng cho đứa con tinh thần mới nhất của mình. Ngoài ra, trong phiên bản 2017, kích thước lớn hơn nhưng trọng lượng nhẹ hơn, nội thất cũng sang trọng hơn, vật liệu êm ái hơn là tất cả những gì mà Ford có thể đem đến trong một mẫu xe được trông đợi nhất 2017.', 'Honda Fiesta – 579 triệu', '', 'publish', 'closed', 'closed', '', 'honda-fiesta-579-trieu', '', '', '2020-07-29 15:41:30', '2020-07-29 08:41:30', '', 0, 'http://thanhvinhweb.net/?post_type=san-pham&#038;p=50', 0, 'san-pham', '', 0),
