(52, 1, '2020-07-29 15:42:43', '2020-07-29 08:42:43', '<a title=\"xe oto duoi 600 trieu\" href=\"https://sanxeoto.com/images/source/gia_xe_oto/xe-oto-duoi-600-trieu-3.jpg\" data-fancybox=\"gallery\"><img class=\"prettyimg\" src=\"https://sanxeoto.com/images/source/gia_xe_oto/xe-oto-duoi-600-trieu-3.jpg\" alt=\"xe oto duoi 600 trieu\" width=\"650\" height=\"365\" /></a>\r\n\r\nCông nghệ vượt trội, vận hành mạnh mẽ trong một vẻ ngoài đầy sang trọng, sánh bước cùng Honda City không thể không có cảm giác tự hào. Ngoài ra, đến từ một thương hiệu nổi tiếng là bền bỉ, tiết kiệm, Honda City là sự lựa chọn của nhiều khách hàng cần mua xe để sử dụng lâu dài.', 'Honda City – 583 triệu', '', 'publish', 'closed', 'closed', '', 'honda-city-583-trieu', '', '', '2020-07-29 15:42:43', '2020-07-29 08:42:43', '', 0, 'http://thanhvinhweb.net/?post_type=san-pham&#038;p=52', 0, 'san-pham', '', 0),
