(54, 1, '2020-07-29 15:44:00', '2020-07-29 08:44:00', '<a title=\"xe oto duoi 600 trieu\" href=\"https://sanxeoto.com/images/source/gia_xe_oto/xe-oto-duoi-600-trieu-4.jpg\" data-fancybox=\"gallery\"><img class=\"prettyimg\" src=\"https://sanxeoto.com/images/source/gia_xe_oto/xe-oto-duoi-600-trieu-4.jpg\" alt=\"xe oto duoi 600 trieu\" width=\"500\" height=\"325\" /></a>\r\n\r\nViệc phát triển thiết kế nhận dạng thương hiệu đã giúp nhà sản xuất đến từ Nhật Bản có lối đi riêng trong những đám đông. Vô lăng vừa tay, xoay trở rất nhẹ nhàng đi cùng hệ thống chân ga phản ứng nhanh giúp Mazda 2 cực kỳ tiện lợi trong điều kiện đường thành thị đông đúc. Ngoài ra, khả năng cách âm cực kỳ tốt giúp cabin rất yên tĩnh và thoải mái.', 'Honda 2 – 585 triệu', '', 'publish', 'closed', 'closed', '', 'honda-2-585-trieu', '', '', '2020-07-30 14:27:44', '2020-07-30 07:27:44', '', 0, 'http://thanhvinhweb.net/?post_type=san-pham&#038;p=54', 0, 'san-pham', '', 0),
