(58, 1, '2020-07-29 15:47:37', '2020-07-29 08:47:37', 'BMW 118i là dòng xe hathback được nhà phân phối cũ là Euro Auto giới thiệu tại Việt Nam từ cuối năm 2015. Chiếc xe được nhập khẩu từ Cộng Hòa Liên Bang Đức nhanh chóng thu hút khách hàng bởi kiểu dáng đẹp, công nghệ tiên tiến, tiết kiệm nhiên liệu hiệu quả bất ngờ, cảm giác lái phấn khích với 3 chế độ riêng biệt, không gian nội thất thiết kế tinh tế và rộng rãi, khoang hành lý thuận tiện và đa dụng...\r\n\r\nBMW 118i là đối thủ xứng tầm của Mercedes A200 tại Việt Nam.\r\n\r\n<img src=\"https://giaxeoto.vn/public/admin/webroot/img/upload2/gia-xe-bmw-118i-mau-cam.png\" alt=\"gia-xe-bmw-series-1\" />\r\n\r\nXem thêm: <a href=\"https://giaxeoto.vn/bmw-118i-118d-368.html\"><span class=\"blue\">BMW 118i</span></a>\r\n\r\n<em>Giá xe BMW</em> 118i High: 1,199 tỷ VNĐ', 'BMW Series 1', '', 'publish', 'closed', 'closed', '', 'bmw-series-1', '', '', '2020-07-29 15:47:37', '2020-07-29 08:47:37', '', 0, 'http://thanhvinhweb.net/?post_type=san-pham&#038;p=58', 0, 'san-pham', '', 0),
