(60, 1, '2020-07-29 15:48:55', '2020-07-29 08:48:55', 'Ra mắt vào tháng 04/2016, mẫu xe gia đình MPV đầu tiên của thương hiệu xe sang BMW tại Việt Nam là 218i Gran Tourer đã chính thức chốt giá bán gây bất ngờ khi được cho là “mềm” hơn so với các thương hiệu Kia, Honda dù không cùng hạng. Xe có dung tích 1.5L, sản sinh công suất tối đa 136 mã lực và mô-men xoắn cực đại 220 Nm. Xe chỉ mất 9,8 giây để đạt được ngưỡng 100 km/h với vận tốc tối đa 202 km/h. Xe có 3 chế độ lái khác nhau như Eco Pro, Comfort và Sport với mức tiêu thụ nhiên liệu 5,5 lít/ 100km\r\n\r\n<img src=\"https://giaxeoto.vn/admin/webroot/img/upload2/gia-xe-BMW-Series2-Gran-Tourer.jpg\" alt=\"gia-xe-BMW-Series2-Gran-Tourer\" />\r\n\r\nGiá BMW 218i Standard (2017): 1,249 tỷ VNĐ\r\n\r\nGiá BMW 218i LCi: 1,299 tỷ VNĐ', 'BMW Series 2', '', 'publish', 'closed', 'closed', '', 'bmw-series-2', '', '', '2020-07-29 15:48:55', '2020-07-29 08:48:55', '', 0, 'http://thanhvinhweb.net/?post_type=san-pham&#038;p=60', 0, 'san-pham', '', 0),
