(62, 1, '2020-07-29 15:49:58', '2020-07-29 08:49:58', 'BMW SERIES 3 (g20) bản nâng cấp đã chính thức có mặt tại Việt Nam từ tháng 4 năm 2020. G20 được giới thiệu 3 phiên bản mới: 320i Sport Line, 320i Sport Line Plus và 330i M Sport. 3 Series thế hệ mới thiết kế theo ngôn ngữ mới nhất của BMW với \"phom\" rộng, thấp và nhiều đường nét nổi, khiến chiếc xe có kiểu dáng tổng thể khỏe khoắn nhưng vẫn sang trọng. Phiên bản cao cấp nhất là BMW 330i M Sport sử dụng động cơ i4 2.0L cho công suất 258Hp và mô men xoắn khủng 400Nm. Hộp số tự động 8AT.\r\n\r\nBMW SERIES 3 là đối thủ cạnh tranh trực tiếp với Mercedes C - Class, Audi A4, Audi A3, Lexus ES trong thị trường sedan hạng sang tại Việt Nam.\r\n\r\n<img src=\"https://giaxeoto.vn/admin/webroot/img/upload2/gia-xe-bmw-330i-m-sport.jpg\" alt=\"gia-xe-bmw-330i-m-sport\" />', 'BMW Series 3', '', 'publish', 'closed', 'closed', '', 'bmw-series-3', '', '', '2020-07-29 15:49:58', '2020-07-29 08:49:58', '', 0, 'http://thanhvinhweb.net/?post_type=san-pham&#038;p=62', 0, 'san-pham', '', 0),
