(82, 1, '2020-07-30 07:51:27', '2020-07-30 00:51:27', '<p class=\"Normal\">Cây xà cừ đường kính khoảng 50 cm, tán rộng, lá xanh tốt, đổ khi trời không mưa. Thân cây đè trúng hai taxi và một xe tải dưới một tấn đang đi trên đường Trần Hưng Đạo, phường Bạch Đằng, quận Hai Bà Trưng, khiến các phương tiện này bị hư hỏng. Rất may, những người trên xe không bị thương.</p>\r\n<p class=\"Normal\">Sự cố khiến đoạn đường Trần Hưng Đạo bị ùn ứ kéo dài cả hai đầu. Cảnh sát giao thông và cảnh sát cứu hộ đã tới hiện trường phân luồng, cắt cành cây.</p>', 'Xà cừ đổ đè trúng ba ôtô', '', 'publish', 'open', 'open', '', 'xa-cu-do-de-trung-ba-oto', '', '', '2020-07-30 07:51:27', '2020-07-30 00:51:27', '', 0, 'http://thanhvinhweb.net/?p=82', 0, 'post', '', 0),
