(84, 1, '2020-07-30 07:51:27', '2020-07-30 00:51:27', '<p class=\"Normal\">Cây xà cừ đường kính khoảng 50 cm, tán rộng, lá xanh tốt, đổ khi trời không mưa. Thân cây đè trúng hai taxi và một xe tải dưới một tấn đang đi trên đường Trần Hưng Đạo, phường Bạch Đằng, quận Hai Bà Trưng, khiến các phương tiện này bị hư hỏng. Rất may, những người trên xe không bị thương.</p>\r\n<p class=\"Normal\">Sự cố khiến đoạn đường Trần Hưng Đạo bị ùn ứ kéo dài cả hai đầu. Cảnh sát giao thông và cảnh sát cứu hộ đã tới hiện trường phân luồng, cắt cành cây.</p>', 'Xà cừ đổ đè trúng ba ôtô', '', 'inherit', 'closed', 'closed', '', '82-revision-v1', '', '', '2020-07-30 07:51:27', '2020-07-30 00:51:27', '', 82, 'http://thanhvinhweb.net/82-revision-v1.html', 0, 'revision', '', 0),
(85, 1, '2020-07-30 07:53:08', '2020-07-30 00:53:08', '<p class=\"Normal\">Cành phượng gãy có đường kính 20 cm, đè lên ôtô Honda Civic đang đỗ dưới lòng đường và bốn xe máy để trên vỉa hè, làm hỏng một phần cổng ra vào của Phòng Quản lý xuất nhập cảnh (Công an thành phố Hải Phòng).</p>\r\n<p class=\"Normal\">Lúc xảy ra sự cố, một số người tham gia giao thông đã kịp thời phát hiện, di chuyển đến nơi an toàn nên không có thiệt hại về người.</p>\r\n<p class=\"Normal\">Theo ông Lê Văn Tuân, Chủ tịch HĐQT Công ty công viên cây xanh Hải Phòng, cây phượng gãy cành khoảng 70 tuổi, nằm trong danh mục cây xanh đường phố được bảo tồn.</p>', 'Cành phượng rơi đè bẹp ôtô', '', 'publish', 'open', 'open', '', 'canh-phuong-roi-de-bep-oto', '', '', '2020-07-30 07:53:08', '2020-07-30 00:53:08', '', 0, 'http://thanhvinhweb.net/?p=85', 0, 'post', '', 0),
