(87, 1, '2020-07-30 07:53:08', '2020-07-30 00:53:08', '<p class=\"Normal\">Cành phượng gãy có đường kính 20 cm, đè lên ôtô Honda Civic đang đỗ dưới lòng đường và bốn xe máy để trên vỉa hè, làm hỏng một phần cổng ra vào của Phòng Quản lý xuất nhập cảnh (Công an thành phố Hải Phòng).</p>\r\n<p class=\"Normal\">Lúc xảy ra sự cố, một số người tham gia giao thông đã kịp thời phát hiện, di chuyển đến nơi an toàn nên không có thiệt hại về người.</p>\r\n<p class=\"Normal\">Theo ông Lê Văn Tuân, Chủ tịch HĐQT Công ty công viên cây xanh Hải Phòng, cây phượng gãy cành khoảng 70 tuổi, nằm trong danh mục cây xanh đường phố được bảo tồn.</p>', 'Cành phượng rơi đè bẹp ôtô', '', 'inherit', 'closed', 'closed', '', '85-revision-v1', '', '', '2020-07-30 07:53:08', '2020-07-30 00:53:08', '', 85, 'http://thanhvinhweb.net/85-revision-v1.html', 0, 'revision', '', 0),
(88, 1, '2020-07-30 07:55:59', '2020-07-30 00:55:59', '<p class=\"Normal\">Kinh doanh các sản phẩm công nghệ cao đòi hỏi Vingroup phải quan tâm tới các vấn đề tuân thủ luật pháp, phát triển bền vững và bảo vệ môi trường. CNN cho rằng đó là điều sẽ \"làm khó\" doanh nghiệp đến từ Việt Nam - một quốc gia chưa có nhiều kinh nghiệm trong lĩnh vực sản xuất các sản phẩm công nghệ - công nghiệp, nhưng đại diện của Vingroup khẳng định, tập đoàn có tầm nhìn xa hơn. \"Từ trước tới nay, chúng tôi luôn chú trọng vào việc bảo vệ môi trường. Đây là trách nhiệm của Vingroup đối với Việt Nam nói riêng, thế giới nói chung\", bà Thủy nói thêm.</p>\r\n\r\n<figure class=\"tplCaption action_thumb_added\" data-size=\"true\">\r\n<div class=\"fig-picture\"><picture><source srcset=\"https://i1-kinhdoanh.vnecdn.net/2020/07/18/Anh-4-VinFast-4307-1595080370.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=IdTcfZ7xB1t6AZfHIXO9Qw 1x, https://i1-kinhdoanh.vnecdn.net/2020/07/18/Anh-4-VinFast-4307-1595080370.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=krcncbCT1R_Ebtioqon2Xw 1.5x, https://i1-kinhdoanh.vnecdn.net/2020/07/18/Anh-4-VinFast-4307-1595080370.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=2qDbvmKD0Lhbh80-MIDbRA 2x\" data-srcset=\"https://i1-kinhdoanh.vnecdn.net/2020/07/18/Anh-4-VinFast-4307-1595080370.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=IdTcfZ7xB1t6AZfHIXO9Qw 1x, https://i1-kinhdoanh.vnecdn.net/2020/07/18/Anh-4-VinFast-4307-1595080370.jpg?w=1020&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=krcncbCT1R_Ebtioqon2Xw 1.5x, https://i1-kinhdoanh.vnecdn.net/2020/07/18/Anh-4-VinFast-4307-1595080370.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=2&amp;fit=crop&amp;s=2qDbvmKD0Lhbh80-MIDbRA 2x\" /><img class=\"lazy lazied\" src=\"https://i1-kinhdoanh.vnecdn.net/2020/07/18/Anh-4-VinFast-4307-1595080370.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=IdTcfZ7xB1t6AZfHIXO9Qw\" alt=\"VinFast đã là thương hiệu ô tô có doanh số tốt trong tháng 5 và tháng 6, cụ thể là 2 mẫu xe VinFast Fadil và VinFast Lux A2.0.\" data-src=\"https://i1-kinhdoanh.vnecdn.net/2020/07/18/Anh-4-VinFast-4307-1595080370.jpg?w=680&amp;h=0&amp;q=100&amp;dpr=1&amp;fit=crop&amp;s=IdTcfZ7xB1t6AZfHIXO9Qw\" data-ll-status=\"loaded\" /></picture></div>\r\n<figcaption>\r\n<p class=\"Image\">VinFast đã là thương hiệu ô tô có doanh số tốt trong tháng 5 và tháng 6, cụ thể là 2 mẫu xe VinFast Fadil và VinFast Lux A2.0.</p>\r\n\r\n</figcaption></figure>\r\n<p class=\"Normal\">Bà cũng chia sẻ với CNN về chính sách xanh đang áp dụng tại VinSmart - nhà máy sản xuất chiếc điện thoại Vsmart. Thực tế, doanh nghiệp đã triển khai chính sách xanh trên toàn tập đoàn với nhiều hành động cụ thể để bảo vệ môi trường. Theo đó, tại VinSmart, doanh nghiệp đã giảm thiểu được 11,2% lượng rác thải nhựa tính từ đầu năm cho đến nay, sẽ t iếp tục giảm để đạt mục tiêu 20% cho cuối năm 2020. Vingroup là thành viên khởi xướng chương trình hành động NPAP (National Plastic Action Plan) - Nói không với rác thải nhựa do Diễn đàn Kinh tế Thế giới - World Economic Forum tổ chức.</p>', 'Vingroup bán ôtô, điện thoại tại Mỹ', '', 'publish', 'open', 'open', '', 'vingroup-ban-oto-dien-thoai-tai-my', '', '', '2020-07-30 07:55:59', '2020-07-30 00:55:59', '', 0, 'http://thanhvinhweb.net/?p=88', 0, 'post', '', 0),
