(92, 1, '2020-07-30 07:57:54', '2020-07-30 00:57:54', '<div class=\"dt-news__sapo\">\r\n\r\nVới thiết kế mới, Kia Seltos có ngoại hình vuông vức, hiện đại. Xe có lưới tản nhiệt dạng mũi hổ đặc trưng, nối liền với dải LED định vị kéo dài. Hệ thống đèn full LED với cấu trúc đa tầng, tạo hiệu ứng thị giác.\r\n\r\nSử dụng các mảng ốp màu đen bên hông, Seltos tăng thêm vẻ khỏe khoắn dù là một chiếc crossover cỡ B. Viền chân kính mạ chrome kéo dài đến hết cột C. Mâm xe 17 inch được tạo hình độc đáo, thiết kế phay xước với logo Kia màu đỏ nổi bật ở tâm.\r\n\r\nĐuôi xe nổi khối, thể thao với ốp giả ống xả kép, cánh gió, ăng-ten vây cá. Kia tiếp tục hào phóng trang bị công nghệ LED cho đèn hậu, các đường mạ chrome tăng điểm nhấn. Cốp mở cơ với khoang hành lý dung tích 433L.\r\n<figure class=\"image align-center img-wrapper\" contenteditable=\"false\"><img class=\"pswp-img\" title=\"Kia Seltos chốt giá từ 589 triệu đồng, cạnh tranh Hyundai Kona, Honda HR-V - 2\" src=\"https://icdn.dantri.com.vn/thumb_w/640/2020/07/22/dscf-0158-1595389118490.jpg\" alt=\"Kia Seltos chốt giá từ 589 triệu đồng, cạnh tranh Hyundai Kona, Honda HR-V - 2\" data-width=\"2048\" data-height=\"1365\" data-original=\"https://icdn.dantri.com.vn/2020/07/22/dscf-0158-1595389118490.jpg\" data-photo-id=\"1009448\" /></figure>\r\n</div>', 'Kia Seltos chốt giá từ 589 triệu đồng', '', 'publish', 'open', 'open', '', 'kia-seltos-chot-gia-tu-589-trieu-dong', '', '', '2020-07-30 07:57:54', '2020-07-30 00:57:54', '', 0, 'http://thanhvinhweb.net/?p=92', 0, 'post', '', 0),
