(98, 1, '2020-07-30 08:00:57', '2020-07-30 01:00:57', 'Bỏ ngỏ phân khúc hatchback cỡ nhỏ cho Morning và Grand i10 tung hoành suốt nhiều năm qua, Toyota đưa Wigo về Việt Nam từ 2018 nhưng đến nay vẫn không tạo được đột phá. Phiên bản 2020 sắp được Toyota ra mắt, kỳ vọng thay đổi cục diện.\r\n\r\nCác hãng xe Nhật khác cũng không khá hơn, thậm chí Suzuki còn phải ngừng phân phối Celerio từ cuối tháng 5. Xếp ở phân khúc cao hơn một chút, Suzuki Swift, Honda Jazz hay Mitsubishi Mirage rơi vào top xe ít khách nhất nửa đầu năm 2020.\r\n<figure class=\"image align-center img-wrapper\" contenteditable=\"false\"><img class=\"pswp-img\" title=\"Người Việt ngày càng chuộng ô tô Hàn - 3\" src=\"https://icdn.dantri.com.vn/thumb_w/640/2020/07/01/xe-lap-rap-sap-ra-mat-duoc-huong-loi-lon-nho-chinh-sach-giam-thue-truoc-badocx-1593541764061.jpeg\" alt=\"Người Việt ngày càng chuộng ô tô Hàn - 3\" data-width=\"2048\" data-height=\"1585\" data-original=\"https://icdn.dantri.com.vn/2020/07/01/xe-lap-rap-sap-ra-mat-duoc-huong-loi-lon-nho-chinh-sach-giam-thue-truoc-badocx-1593541764061.jpeg\" data-photo-id=\"987182\" /></figure>', 'Người Việt ngày càng chuộng ô tô Hàn', '', 'publish', 'open', 'open', '', 'nguoi-viet-ngay-cang-chuong-o-to-han', '', '', '2020-07-30 08:00:57', '2020-07-30 01:00:57', '', 0, 'http://thanhvinhweb.net/?p=98', 0, 'post', '', 0),
